import React from 'react'
import BG1 from '../assets/BG1.mp4'
const LandHome =()=>{
    return(
        <div className="landHome">
            <video
            autoPlay
            loop
            muted

            style={{
                height:"100%",
                width:'100%',
                objectFit:"cover",
            }}
            >
                <source src={BG1} type="video/mp4"/>
            </video>
        </div>
    )
}

export default LandHome
